                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for contenido in contenidos %}
            <tr>
                <td>{{ contenido.id }}</td>
                <td>{{ contenido.TipoContenido }}</td>
                <td>{{ contenido.DescripcionContenido }}</td>
                <td>{{ contenido.EnlaceContenido }}</td>
                <td>
                    <a href=\"{{ path('contenido_show', {'idContenido': contenido.id}) }}\">show</a>
